const Footer = () => {
    return (
        <div>
            <footer className="row align-items-center">
                <div className="btn btn-danger col-2 offset-2 text-center">
                    Send me an <span className="email text-uppercase small">email</span>
                </div>
            </footer>
        </div>
    );
};

export default Footer;
